import React, { useState, useEffect } from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';
import axios from 'axios';

const Sidebar = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const [users, setUsers] = useState([]);
    const userRole = localStorage.getItem('role'); // Admin ya Operator

    useEffect(() => {
        // Sirf Admin ke liye users fetch karo
        if (userRole === 'admin') {
            fetchUsers();
        }
    }, [userRole]);

    const fetchUsers = async () => {
        try {
            const res = await axios.get('http://127.0.0.1:8000/api/admin/users');
            setUsers(res.data);
        } catch (err) {
            console.error("Users load nahi ho sakay");
        }
    };

    return (
        <div style={styles.sidebar}>
            <div style={styles.logoSection}>
                <div style={styles.logoIcon}>üõ°Ô∏è</div>
                <h3 style={{ margin: 0, color: '#38bdf8' }}>DeepGuard</h3>
            </div>

            {/* Common Menu for Everyone */}
            <div style={styles.sectionLabel}>MAIN MENU</div>
            <Link to="/dashboard" style={styles.link(location.pathname === '/dashboard')}>
                üìä Dashboard
            </Link>
            <Link to="/history" style={styles.link(location.pathname === '/history')}>
                üìú Analysis History
            </Link>

            {/* --- ADMIN ONLY SECTION --- */}
            {userRole === 'admin' && (
                <>
                    <div style={styles.sectionLabel}>IDENTITY MANAGEMENT</div>
                    
                    {/* Add New User Button */}
                    <Link to="/admin-panel" style={styles.addBtn}>
                        ‚ûï Assign New Member
                    </Link>

                    {/* Dynamic User List in Sidebar */}
                    <div style={styles.userListContainer}>
                        {users.map(u => (
                            <div key={u.user_id} style={styles.userItem}>
                                <span style={styles.statusDot(u.is_active)}></span>
                                <div style={{display: 'flex', flexDirection: 'column'}}>
                                    <span style={styles.userName}>{u.full_name}</span>
                                    <span style={styles.userRoleText}>{u.role.toUpperCase()}</span>
                                </div>
                            </div>
                        ))}
                    </div>
                </>
            )}

            <button onClick={() => { localStorage.clear(); navigate('/'); }} style={styles.logoutBtn}>
                üö™ Logout System
            </button>
        </div>
    );
};

const styles = {
    sidebar: { width: '260px', backgroundColor: '#0f172a', height: '100vh', padding: '20px', borderRight: '1px solid #1e293b', display: 'flex', flexDirection: 'column', overflowY: 'auto' },
    logoSection: { textAlign: 'center', marginBottom: '30px' },
    logoIcon: { fontSize: '40px', marginBottom: '10px' },
    sectionLabel: { fontSize: '11px', color: '#64748b', letterSpacing: '1px', marginBottom: '15px', marginTop: '20px' },
    link: (active) => ({
        display: 'block', padding: '12px 15px', borderRadius: '10px', textDecoration: 'none',
        color: active ? '#38bdf8' : '#94a3b8', backgroundColor: active ? '#1e293b' : 'transparent',
        marginBottom: '5px', fontWeight: active ? 'bold' : 'normal', transition: '0.3s'
    }),
    addBtn: {
        display: 'block', padding: '10px', borderRadius: '8px', backgroundColor: '#38bdf8',
        color: '#0f172a', textDecoration: 'none', textAlign: 'center', fontWeight: 'bold',
        fontSize: '13px', marginBottom: '15px'
    },
    userListContainer: { marginTop: '10px', maxHeight: '300px', overflowY: 'auto' },
    userItem: { display: 'flex', alignItems: 'center', gap: '10px', padding: '8px 10px', borderRadius: '8px', backgroundColor: '#1e293b55', marginBottom: '5px' },
    statusDot: (active) => ({ width: '8px', height: '8px', borderRadius: '50%', backgroundColor: active ? '#22c55e' : '#64748b' }),
    userName: { fontSize: '13px', color: '#f8fafc' },
    userRoleText: { fontSize: '10px', color: '#38bdf8', fontWeight: 'bold' },
    logoutBtn: { marginTop: 'auto', padding: '12px', borderRadius: '8px', border: '1px solid #ef4444', backgroundColor: 'transparent', color: '#ef4444', cursor: 'pointer' }
};

export default Sidebar;
